(357, 1, '2021-10-07 14:44:27', '2021-10-07 14:44:27', '<p>A business strategy is a powerful tool for helping you reach your business goals, defining the methods and tactics you need to take within your company. The business strategy also guides many of your organizational decisions, such as hiring new employees.</p><p style=\"text-align: start\">Creating a business strategy that\'s in line with the vision you have for your company takes time and development. In this article, we’ll discuss what a business strategy is and why it\'s important, the components of a business strategy and 10 examples of business strategies to help you generate ideas for your own company.</p>', 'Connet strategy and culture', '', 'publish', 'open', 'closed', '', 'connet-strategy-and-culture', '', '', '2021-10-07 14:44:27', '2021-10-07 14:44:27', '', 0, 'https://elearning.sites.qsandbox.com/lesson/connet-strategy-and-culture/', 0, 'mto-lesson', '', 0),
