(372, 1, '2021-10-07 14:56:13', '2021-10-07 14:56:13', '<p>Travel is the movement of people between distant geographical locations. Travel can be done by foot, bicycle, automobile, train, boat, bus, airplane, ship or other means, with or without luggage, and can be one way or round trip.</p><p>Lorem ipsum dolor sit amet consectetur adipiscing elit, hendrerit ac sodales cursus donec vestibulum, vulputate class orci nostra felis habitasse. Tincidunt mattis enim conubia tempor lacus varius, leo laoreet eget suspendisse cubilia arcu scelerisque, vehicula imperdiet habitant fermentum est. Vivamus sagittis proin suscipit rutrum aliquam semper facilisi feugiat placerat congue, himenaeos justo dui fames lectus neque quam venenatis massa metus, sem curae volutpat dapibu</p>', 'Travel Management Course', '', 'publish', 'open', 'closed', '', 'travel-management-course', '', '', '2021-10-07 14:56:13', '2021-10-07 14:56:13', '', 0, 'https://elearning.sites.qsandbox.com/?post_type=mto-course&amp;p=372', 0, 'mto-course', '', 0),
