(377, 1, '2021-10-07 14:59:40', '2021-10-07 14:59:40', '<p>Travel management is a specialism, which is based around organising corporate travel, tracking your various travel expenses and devising a comprehensive travel strategy. As a discipline, it is intended to help businesses and their employees to optimise the way they deal with their travel needs. This means making sure everything is handled properly, while minimising any negative impact on things like productivity and financial results.</p>', 'Course Overview', '', 'publish', 'open', 'closed', '', 'course-overview', '', '', '2021-10-07 14:59:40', '2021-10-07 14:59:40', '', 376, 'https://elearning.sites.qsandbox.com/lesson/course-overview/', 0, 'mto-lesson', '', 0),
(378, 1, '2021-10-07 15:00:10', '2021-10-07 15:00:10', '', 'Introduction to Travel Geography', '', 'publish', 'closed', 'closed', '', 'introduction-to-travel-geography', '', '', '2021-10-07 15:00:10', '2021-10-07 15:00:10', '', 0, 'https://elearning.sites.qsandbox.com/section/introduction-to-travel-geography/', 1, 'mto-section', '', 0),
(379, 1, '2021-10-07 15:00:31', '2021-10-07 15:00:31', '<p><strong>Tourism geography</strong> is the study of travel, as an industry and as activity. Tourism geography covers a wide range of interests including the environmental , the geographies of tourism and leisure economies, answering tourism industry and management concerns and the sociology of tourism and locations of tourism.</p><p style=\"text-align: start\">Tourism geography is that branch of that deals with the study of travel and its impact on places.</p><p style=\"text-align: start\">Geography is fundamental to the study of tourism, because tourism is geographical in nature. Tourism occurs in places, it involves movement and activities between places and it is an activity in which both place characteristics and personal self-identities are formed, through the relationships that are created among places, landscapes and people. Physical geography provides the essential background, against which tourism places are created and environmental impacts and concerns are major issues, that must be considered in managing the development of tourism places.</p>', 'What is Travel Geography?', '', 'publish', 'open', 'closed', '', 'what-is-travel-geography', '', '', '2021-10-07 15:00:31', '2021-10-07 15:00:31', '', 378, 'https://elearning.sites.qsandbox.com/lesson/what-is-travel-geography/', 0, 'mto-lesson', '', 0),
