(384, 1, '2021-10-07 15:01:22', '2021-10-07 15:01:22', '<p>Learning how to read sheet music may seem complex, but it’s simpler than you think. You simply need to learn the names of the lines and spaces on the musical staff, understand note values, and then discover how the symbols on the page relate to your right and left hands on the keyboard. Then, all you need is practice. We’ll cover all of these topics in this article.&nbsp;</p><p>After all, we’ve all heard a tune on the radio and thought, “Wow, I would love to be able to play that.” And we’ve all been envious of friends and family members who have performed in bands, constantly fantasizing about rocking out on stage with them.</p>', 'Lattitude and Longitude', '', 'publish', 'open', 'closed', '', 'lattitude-and-longitude', '', '', '2021-10-07 15:01:22', '2021-10-07 15:01:22', '', 383, 'https://elearning.sites.qsandbox.com/lesson/lattitude-and-longitude/', 0, 'mto-lesson', '', 0),
