(406, 1, '2021-10-07 15:24:04', '2021-10-07 15:24:04', '<p>The piano is an acoustic, keyboard and stringed musical instrument invented in Italy by Bartolomeo Cristofori around the year 1700, in which the strings are struck by wooden hammers that are coated with a softer material.</p><p>Learning how to read sheet music may seem complex, but it’s simpler than you think. You simply need to learn the names of the lines and spaces on the musical staff, understand note values, and then discover how the symbols on the page relate to your right and left hands on the keyboard. Then, all you need is practice. We’ll cover all of these topics in this article.&nbsp;</p><p>After all, we’ve all heard a tune on the radio and thought, “Wow, I would love to be able to play that.” And we’ve all been envious of friends and family members who have performed in bands, constantly fantasizing about rocking out on stage with them.</p>', 'Intro to notes', '', 'publish', 'open', 'closed', '', 'intro-to-notes', '', '', '2021-10-07 15:24:04', '2021-10-07 15:24:04', '', 398, 'https://elearning.sites.qsandbox.com/lesson/intro-to-notes/', 1, 'mto-lesson', '', 0),
