(449, 1, '2021-10-08 02:08:00', '2021-10-08 02:08:00', '<p>WordPress is a free and open-source content management system written in PHP and paired with a MySQL or MariaDB database. Features include a plugin architecture and a template system, referred to within WordPress as Themes.</p><p>Blandit fames ligula rutrum imperdiet. Consequat iaculis purus mollis potenti dictum vehicula, pharetra pellentesque taciti sociis ornare natoque, interdum commodo parturient sapien phasellus.</p>', 'The Complete WordPress Website Business Course', '', 'publish', 'open', 'closed', '', 'the-complete-wordpress-website-business-course', '', '', '2021-10-08 02:08:00', '2021-10-08 02:08:00', '', 0, 'https://elearning.sites.qsandbox.com/?post_type=mto-course&amp;p=449', 0, 'mto-course', '', 0),
