(451, 1, '2021-10-08 02:09:21', '2021-10-08 02:09:21', '<p><strong>About Wordpress:</strong></p><p>Wordpress began in 2003 as a piece of free blogging software created by Mike Little and Mike Mullenweg, who continues to run Wordpress.org, the company that makes WordPress available to anyone who wants to create a website or blog. In developing WordPress and making it perpetually free, its creators hoped to “democratize publishing” by designing a site building program that could allow anyone to have a voice and presence online.</p><p style=\"text-align: start\">The features that made WordPress so appealing to bloggers and other kinds of Internet publishers also appealed to a far wider audience, including some of the most prominent companies in the US and around the world. Now, WordPress is the platform of choice for a long list of household names including Sony Music, Variety, Time, Inc. and the Disney Company, along with millions of smaller business and personal sites. The most recent version of the platform has been downloaded over 22 million times so far, and new versions continue to be developed by the large WordPress user community.</p>', 'WordPess Tour and Different Versions', '', 'publish', 'open', 'closed', '', 'wordpess-tour-and-different-versions', '', '', '2021-10-08 02:09:21', '2021-10-08 02:09:21', '', 450, 'https://elearning.sites.qsandbox.com/lesson/wordpess-tour-and-different-versions/', 0, 'mto-lesson', '', 0),
(452, 1, '2021-10-08 02:09:54', '2021-10-08 02:09:54', '<p>WordPress is a free and open-source content management system written in PHP and paired with a MySQL or MariaDB database. Features include a plugin architecture and a template system, referred to within WordPress as Themes.</p><p>Blandit fames ligula rutrum imperdiet. Consequat iaculis purus mollis potenti dictum vehicula, pharetra pellentesque taciti sociis ornare natoque, interdum commodo parturient sapien phasellus.</p>', 'Tools required for WordPress setup', '', 'publish', 'open', 'closed', '', 'tools-required-for-wordpress-setup', '', '', '2021-10-08 02:09:54', '2021-10-08 02:09:54', '', 450, 'https://elearning.sites.qsandbox.com/lesson/tools-required-for-wordpress-setup/', 1, 'mto-lesson', '', 0),
(453, 1, '2021-10-08 02:10:50', '2021-10-08 02:10:50', '', 'Install WordPress, Prepare Domain and Hosting Server', '', 'publish', 'closed', 'closed', '', 'install-wordpress-prepare-domain-and-hosting-server', '', '', '2021-10-08 02:10:50', '2021-10-08 02:10:50', '', 449, 'https://elearning.sites.qsandbox.com/section/install-wordpress-prepare-domain-and-hosting-server/', 1, 'mto-section', '', 0),
(454, 1, '2021-10-08 02:11:40', '2021-10-08 02:11:40', '<p>If you’re a WordPress developer, you probably do most of your work in test environments. That way, you can, themes, and sites all you want without breaking anything for real. The only question is, which local WordPress development tools are the best fit for your needs?</p>', 'Setup WordPress Locally', '', 'publish', 'open', 'closed', '', 'setup-wordpress-locally', '', '', '2021-10-08 02:11:40', '2021-10-08 02:11:40', '', 453, 'https://elearning.sites.qsandbox.com/lesson/setup-wordpress-locally/', 0, 'mto-lesson', '', 0),
(455, 1, '2021-10-08 02:12:23', '2021-10-08 02:12:23', '<p>WordPress is written using PHP as its scripting language and MySQL as its database management system. In order to you don’t really need to learn either of them.</p><p style=\"text-align: start\">However, a very basic understanding of the two could help you troubleshoot problems as well as increase your understanding of how WordPress works.</p><p style=\"text-align: start\">In this article, we will explain how WordPress uses the database including an intro to default WordPress database tables.</p><p style=\"text-align: start\">We will also show you how to manage a WordPress database using phpMyAdmin which will include creating database backups, optimizing the WordPress database, and more.</p>', 'Explore WordPress Files and Database', '', 'publish', 'open', 'closed', '', 'explore-wordpress-files-and-database', '', '', '2021-10-08 02:12:23', '2021-10-08 02:12:23', '', 0, 'https://elearning.sites.qsandbox.com/lesson/explore-wordpress-files-and-database/', 1, 'mto-lesson', '', 0),
(456, 1, '2021-10-08 02:13:04', '2021-10-08 02:13:04', '', 'Build Homepage using WordPress', '', 'publish', 'closed', 'closed', '', 'build-homepage-using-wordpress', '', '', '2021-10-08 02:13:04', '2021-10-08 02:13:04', '', 449, 'https://elearning.sites.qsandbox.com/section/build-homepage-using-wordpress/', 2, 'mto-section', '', 0),
(457, 1, '2021-10-08 02:13:24', '2021-10-08 02:13:24', '<p>If you’re a WordPress developer, you probably do most of your work in test environments. That way, you can, themes, and sites all you want without breaking anything for real. The only question is, which local WordPress development tools are the best fit for your needs?</p>', 'Change Theme and Modify Homepage', '', 'publish', 'open', 'closed', '', 'change-theme-and-modify-homepage', '', '', '2021-10-08 02:13:24', '2021-10-08 02:13:24', '', 456, 'https://elearning.sites.qsandbox.com/lesson/change-theme-and-modify-homepage/', 0, 'mto-lesson', '', 0),
(458, 1, '2021-10-08 02:13:55', '2021-10-08 02:13:55', '<p>In WordPress, the first step to publishing starts with creating a new page or post by selecting the blocks you’ll need for the kind of content you plan to include. The editor comes with a set of default blocks for adding basic elements such as text, headers, and images.</p><p style=\"text-align: start\">You’re well on your way to publishing your WordPress site if you’ve chosen a great theme and added some key plugins to help optimize your website. Now you are ready to start creating content to get your site ready to share with the world.</p>', 'Create Navigation, Header and Footer', '', 'publish', 'open', 'closed', '', 'create-navigation-header-and-footer', '', '', '2021-10-08 02:13:55', '2021-10-08 02:13:55', '', 456, 'https://elearning.sites.qsandbox.com/lesson/create-navigation-header-and-footer/', 1, 'mto-lesson', '', 0),
(459, 1, '2021-10-08 02:14:36', '2021-10-08 02:14:36', '', 'Select Themes for Site', '', 'publish', 'closed', 'closed', '', 'select-themes-for-site', '', '', '2021-10-08 02:14:36', '2021-10-08 02:14:36', '', 449, 'https://elearning.sites.qsandbox.com/section/select-themes-for-site/', 3, 'mto-section', '', 0),
(460, 1, '2021-10-08 02:14:58', '2021-10-08 02:14:58', '<p>A WordPress theme is a tool to change the layout and design of your website. Themes customize the appearance of your site, including the layout, typography, color, and other design elements.</p>\n<p style=\"text-align: start\">A theme is a zipped folder with a group of files, including a set of page templates written in the PHP programming language combined with some CSS.</p>\n<p style=\"text-align: start\">At first, it will come with a default installed. You can change the theme in WordPress to match your needs and industry.</p>\n<p style=\"text-align: start\">Choosing the right theme can make your website more attractive, easier to use, and improve visitor engagement.</p>\n', 'Why Themes?', '', 'publish', 'open', 'closed', '', 'why-themes', '', '', '2021-10-08 02:14:58', '2021-10-08 02:14:58', '', 459, 'https://elearning.sites.qsandbox.com/lesson/why-themes/', 0, 'mto-lesson', '', 0),
(461, 1, '2021-10-08 02:15:19', '2021-10-08 02:15:19', '<p>Another option you have when creating sites based on your framework is to use plugins in conjunction with your child themes. A plugin won\'t replace a child theme completely, but it can be useful in the following circumstances:</p><ul><li><p>The functionality you want to add isn\'t theme-dependent (i.e. you want to keep it if the site ever changes theme in future). This might include registering custom post types or taxonomies, for example.</p></li><li><p>You want to use this functionality on a number of the sites you create, but not enough for it to go into a starter child theme or the framework itself.</p></li></ul>', 'What is Frameworks and Child Themes', '', 'publish', 'open', 'closed', '', 'what-is-frameworks-and-child-themes', '', '', '2021-10-08 02:15:19', '2021-10-08 02:15:19', '', 459, 'https://elearning.sites.qsandbox.com/lesson/what-is-frameworks-and-child-themes/', 1, 'mto-lesson', '', 0),
(462, 1, '2021-10-08 02:15:40', '2021-10-08 02:15:40', '<p>A plugin is a piece of software that acts as an add-on to a web browser and gives the browser additional functionality. Plugins can allow a web browser to display additional content it was not originally designed to display.</p><p style=\"text-align: start\">An example of a plugin is the free Macromedia Flash Player, a plugin that allows the web browser to display animations using the Flash format. As the Web has become more commercial, Flash has become a popular format for displaying ads in web pages. As a result, many web users have been prompted to download the Flash plug in and have it installed on their systems.</p>', 'What is Plugin and How to use it', '', 'publish', 'open', 'closed', '', 'what-is-plugin-and-how-to-use-it', '', '', '2021-10-08 02:15:40', '2021-10-08 02:15:40', '', 459, 'https://elearning.sites.qsandbox.com/lesson/what-is-plugin-and-how-to-use-it/', 2, 'mto-lesson', '', 0),
