(559, 1, '2021-10-08 05:07:35', '2021-10-08 05:07:35', '<p>These days there are lot of programing languages to learn and front-end developing has been in the next level these days.</p>\n<p style=\"text-align: start\">\n<p style=\"text-align: start\">Today under Programming course we are providing React.js course.</p>\n<p style=\"text-align: start\">\n<p style=\"text-align: start\">React (also known as React.js or ReactJS) is a free and open-source front-end JavaScript library[3] for building user interfaces or UI components. It is maintained by Facebook and a community of individual developers and companies.[4][5][6] React can be used as a base in the development of single-page or mobile applications. However, React is only concerned with state management and rendering that state to the DOM, so creating React applications usually requires the use of additional libraries for routing, as well as certain client-side functionality.[7]</p>\n<p style=\"text-align: start\">\n<p style=\"text-align: start\">The following is a rudimentary example of React usage in HTML with JSX and JavaScript.</p>\n<p style=\"text-align: start\"><code>&lt;div id=\"myReactApp\"&gt;&lt;/div&gt;</code></p>\n<p style=\"text-align: start\"><code>&lt;script type=\"text/babel\"&gt;</code></p>\n<p style=\"text-align: start\"><code>function Greeter(props) {</code></p>\n<p style=\"text-align: start\"><code>return &lt;h1&gt;{props.greeting}&lt;/h1&gt;;</code></p>\n<p style=\"text-align: start\"><code>}</code></p>\n<p style=\"text-align: start\"><code>let App = &lt;Greeter greeting=\"Hello World!\" /&gt;;</code></p>\n<p style=\"text-align: start\"><code>ReactDOM.render(App, document.getElementById(\'myReactApp\'));</code></p>\n<p style=\"text-align: start\"><code>&lt;/script&gt;</code></p>\n<p style=\"text-align: start\">The Greeter function is a React component that accepts a property greeting. The variable App is an instance of the Greeter component where the greeting property is set to ‘Hello World!’. The ReactDOM.render method then renders our Greeter component inside the DOM element with id myReactApp.</p>\n<p style=\"text-align: start\">When displayed in a web browser the result will be</p>\n<p style=\"text-align: start\"><code>&lt;div id=\"myReactApp\"&gt;</code></p>\n<p style=\"text-align: start\"><code>&lt;h1&gt;Hello World!&lt;/h1&gt;</code></p>\n<p style=\"text-align: start\"><code>&lt;/div&gt;</code></p>\n', 'Programming Course', '', 'publish', 'open', 'closed', '', 'programming-course', '', '', '2021-10-08 05:07:35', '2021-10-08 05:07:35', '', 0, 'https://elearning.sites.qsandbox.com/?post_type=mto-course&amp;p=559', 0, 'mto-course', '', 0),
(561, 1, '2021-10-08 05:08:00', '2021-10-08 05:08:00', '', 'Introduction to React', '', 'publish', 'closed', 'closed', '', 'introduction-to-reat', '', '', '2021-10-08 05:08:00', '2021-10-08 05:08:00', '', 559, 'https://elearning.sites.qsandbox.com/section/introduction-to-reat/', 0, 'mto-section', '', 0),
(562, 1, '2021-10-08 05:08:15', '2021-10-08 05:08:15', '<p><strong>At the end of this course you will:</strong> </p>\n<ul>\n<li>\n<p> Be familiar with client-side Javascript application development and the React library</p>\n</li>\n<li>\n<p>Be able to implement single page applications in React </p>\n</li>\n<li>\n<p>Be able to use various React features including components and forms</p>\n</li>\n<li>\n<p>Be able to implement a functional front-end web application using React</p>\n</li>\n<li>\n<p>Be able to use Reactstrap for designing responsive React applications</p>\n</li>\n<li>\n<p>Be able to use Redux to design the architecture for a React-Redux application</p>\n</li>\n</ul>\n', 'Welcome to Front-End Web Development with React', '', 'publish', 'open', 'closed', '', 'welcome-to-front-end-web-development-with-react', '', '', '2021-10-08 05:08:15', '2021-10-08 05:08:15', '', 561, 'https://elearning.sites.qsandbox.com/lesson/welcome-to-front-end-web-development-with-react/', 0, 'mto-lesson', '', 0),
(563, 1, '2021-10-08 05:08:55', '2021-10-08 05:08:55', '<p><strong>Why learn Node.js?</strong></p>\n<p>JavaScript is one of the most popular programming languages. The powerful Node.js runtime environment has been ranked the technology most commonly used by professional developers. Node.js is an event-driven JavaScript runtime. Node has myriad potential uses for JavaScript development including being a great environment for building efficient network applications.</p>\n', 'Node.js and NPM', '', 'publish', 'open', 'closed', '', 'node-js-and-npm', '', '', '2021-10-08 05:08:55', '2021-10-08 05:08:55', '', 561, 'https://elearning.sites.qsandbox.com/lesson/node-js-and-npm/', 1, 'mto-lesson', '', 0),
(564, 1, '2021-10-08 05:09:11', '2021-10-08 05:09:11', '<p><strong>Why learn React?</strong></p>\n<p>Today, many JavaScript frameworks are available in the market(like angular, node), but still, React came into the market and gained popularity amongst them. The previous frameworks follow the traditional data flow structure, which uses the DOM (Document Object Model). DOM is an object which is created by the browser each time a web page is loaded. It dynamically adds or removes the data at the back end and when any modifications were done, then each time a new DOM is created for the same page. This repeated creation of DOM makes unnecessary memory wastage and reduces the performance of the application.</p>\n<p style=\"text-align: justify\">Therefore, a new technology ReactJS framework invented which remove this drawback. ReactJS allows you to divide your entire application into various components. ReactJS still used the same traditional data flow, but it is not directly operating on the browser\'s Document Object Model (DOM) immediately; instead, it operates on a virtual DOM. It means rather than manipulating the document in a browser after changes to our data, it resolves changes on a DOM built and run entirely in memory. After the virtual DOM has been updated, React determines what changes made to the actual browser\'s DOM. The React Virtual DOM exists entirely in memory and is a representation of the web browser\'s DOM. Due to this, when we write a React component, we did not write directly to the DOM; instead, we are writing virtual components that react will turn into the DOM.</p>\n', 'Introduction to React', '', 'publish', 'open', 'closed', '', 'introduction-to-react', '', '', '2021-10-08 05:09:11', '2021-10-08 05:09:11', '', 561, 'https://elearning.sites.qsandbox.com/lesson/introduction-to-react/', 2, 'mto-lesson', '', 0),
(565, 1, '2021-10-08 05:09:19', '2021-10-08 05:09:19', '', 'React Router and Single Page Applications', '', 'publish', 'closed', 'closed', '', 'react-router-and-single-page-applications', '', '', '2021-10-08 05:09:19', '2021-10-08 05:09:19', '', 559, 'https://elearning.sites.qsandbox.com/section/react-router-and-single-page-applications/', 1, 'mto-section', '', 0),
(566, 1, '2021-10-08 05:09:36', '2021-10-08 05:09:36', '<p><strong>What are React Components?</strong></p>\n<p>Conceptually, components are like JavaScript functions. They accept arbitrary inputs (called “props”) and return React elements describing what should appear on the screen.</p>\n<h2 style=\"text-align: start\"></h2>\n<p></p>\n', 'Lesson on React Components', '', 'publish', 'open', 'closed', '', 'lesson-on-react-components', '', '', '2021-10-08 05:09:36', '2021-10-08 05:09:36', '', 565, 'https://elearning.sites.qsandbox.com/lesson/lesson-on-react-components/', 0, 'mto-lesson', '', 0),
(567, 1, '2021-10-08 05:09:51', '2021-10-08 05:09:51', '<p><strong>Lesson Description:</strong></p>\n<p>React Router is a fully-featured client and server-side routing library for React, a JavaScript library for building user interfaces. React Router runs anywhere React runs; on the web, on the server with node.js, and on React Native.</p>\n<p style=\"text-align: start\">We\'ll keep this tutorial quick and to the point. By the end you\'ll know the APIs you deal with day-to-day with React Router. After that, you can dig into some of the other docs to get a deeper understanding.</p>\n', 'Lesson on React Router', '', 'publish', 'open', 'closed', '', 'lesson-on-react-router', '', '', '2021-10-08 05:09:51', '2021-10-08 05:09:51', '', 565, 'https://elearning.sites.qsandbox.com/lesson/lesson-on-react-router/', 1, 'mto-lesson', '', 0),
(568, 1, '2021-10-08 05:10:11', '2021-10-08 05:10:11', '', 'React Forms, Flow Architecture and Introduction to Redux', '', 'publish', 'closed', 'closed', '', 'react-forms-flow-architecture-and-introduction-to-redux', '', '', '2021-10-08 05:10:11', '2021-10-08 05:10:11', '', 559, 'https://elearning.sites.qsandbox.com/section/react-forms-flow-architecture-and-introduction-to-redux/', 2, 'mto-section', '', 0),
(569, 1, '2021-10-08 05:10:27', '2021-10-08 05:10:27', '<p><strong>About React Forms:</strong></p>\n<p>HTML form elements work a bit differently from other DOM elements in React, because form elements naturally keep some internal state.</p>\n<p>This form has the default HTML form behavior of browsing to a new page when the user submits the form. If you want this behavior in React, it just works. But in most cases, it’s convenient to have a JavaScript function that handles the submission of the form and has access to the data that the user entered into the form. The standard way to achieve this is with a technique called “controlled components”.</p>\n<h2 style=\"text-align: start\"></h2></p>\n', 'Lesson on React Forms', '', 'publish', 'open', 'closed', '', 'lesson-on-react-forms', '', '', '2021-10-08 05:10:27', '2021-10-08 05:10:27', '', 568, 'https://elearning.sites.qsandbox.com/lesson/lesson-on-react-forms/', 0, 'mto-lesson', '', 0),
(570, 1, '2021-10-08 05:10:39', '2021-10-08 05:10:39', '<p><strong>About Flow Architecture:</strong></p>\n<ul>\n<li>\n<p>Data Flow Architecture is transformed input data by a series of computational or manipulative components into output data.</p>\n</li>\n<li>\n<p>It is a computer architecture which do not have a program counter and therefore the execution is unpredictable which means behavior is indeterministic.</p>\n</li>\n<li>\n<p>Data flow architecture is a part of Von-neumann model of computation which consists of a single program counter, sequential execution and control flow which determines fetch, execution, commit order.</p>\n</li>\n<li>\n<p>This architecture has been successfully implemented.</p>\n</li>\n<li>\n<p>Data flow architecture reduces development time and can move easily between design and implementation.</p>\n</li>\n<li>\n<p>It has main objective is to achieve the qualities of reuse and modifiability.</p>\n</li>\n<li>\n<p>In data flow architecture, the data can be flow in the graph topology with cycles or in a linear structure without cycles.</p>\n</li>\n</ul>\n', 'Flow Architecture', '', 'publish', 'open', 'closed', '', 'flow-architecture', '', '', '2021-10-08 05:10:39', '2021-10-08 05:10:39', '', 568, 'https://elearning.sites.qsandbox.com/lesson/flow-architecture/', 1, 'mto-lesson', '', 0),
(571, 1, '2021-10-08 05:10:54', '2021-10-08 05:10:54', '<p><strong>What is Redux?</strong></p>\n<p>Redux is a predictable state container for JavaScript apps.</p>\n<p style=\"text-align: start\">It helps you write applications that behave consistently, run in different environments (client, server, and native), and are easy to test.</p>\n<p style=\"text-align: start\">You can use Redux together with React or with any other view library. It is tiny (2kB, including dependencies), but has a large ecosystem of addons available.</p>\n', 'Introduction to Redux', '', 'publish', 'open', 'closed', '', 'introduction-to-redux', '', '', '2021-10-08 05:10:54', '2021-10-08 05:10:54', '', 568, 'https://elearning.sites.qsandbox.com/lesson/introduction-to-redux/', 2, 'mto-lesson', '', 0),
(572, 1, '2021-10-08 05:11:04', '2021-10-08 05:11:04', '', 'More Redux and Client-Server Communication', '', 'publish', 'closed', 'closed', '', 'more-redux-and-client-server-communication', '', '', '2021-10-08 05:11:04', '2021-10-08 05:11:04', '', 559, 'https://elearning.sites.qsandbox.com/section/more-redux-and-client-server-communication/', 3, 'mto-section', '', 0),
(573, 1, '2021-10-08 05:11:22', '2021-10-08 05:11:22', '<p><strong>About Clint Server Communication:</strong></p>\n<p>Client/Server communication involves two components, namely a client and a server. They are usually multiple clients in communication with a single server. The clients send requests to the server and the server responds to the client requests.</p>\n', 'Client Server Communication', '', 'publish', 'open', 'closed', '', 'client-server-communication', '', '', '2021-10-08 05:11:22', '2021-10-08 05:11:22', '', 572, 'https://elearning.sites.qsandbox.com/lesson/client-server-communication/', 0, 'mto-lesson', '', 0),
(574, 1, '2021-10-08 05:13:55', '2021-10-08 05:13:55', '<p>After the completion of the course, you will walk away with complete knowledge of all the basics of Designing. You will also be a confident designer than before.&nbsp;</p>\n<p style=\"text-align: start\">\n<p style=\"text-align: start\">The best thing about this course is anyone can learn this course. There is no academic qualification required for this course. If you have interest then that is all we need. Moreover as this course is free, you have nothing lose actually.</p>\n<p style=\"text-align: start\">However, you need to register with us before you can join this course. So, why wait, go register today. We are waiting for you.</p>\n<p style=\"text-align: start\">\n<hr>\n<h3 style=\"text-align: start\"><strong>Who is this course for?</strong></h3>\n<ul>\n<li>\n<p>Anyone who is interested.</p>\n</li>\n<li>\n<p>Anyone who is willing to invest time, yes just time no money.</p>\n</li>\n<li>\n<p>Anyone with no knowledge of programming.</p>\n</li>\n</ul>\n<hr>\n<h3 style=\"text-align: start\"><strong>What you will learn after this course?</strong></h3>\n<ul>\n<li>\n<p>You will learn about color selection, font section and spacing. These are the basic elements of any designing course.</p>\n</li>\n<li>\n<p>You will know if you have designing skills within yourself or not.</p>\n</li>\n<li>\n<p>If you are serious then this might open a new career option for you.</p>\n</li>\n</ul>\n', 'Designing Course', '', 'publish', 'open', 'closed', '', 'designing-course', '', '', '2021-10-08 05:13:55', '2021-10-08 05:13:55', '', 0, 'https://elearning.sites.qsandbox.com/?post_type=mto-course&amp;p=574', 0, 'mto-course', '', 0),
(575, 1, '2021-10-08 05:14:07', '2021-10-08 05:14:07', '', 'Front End Development', '', 'publish', 'closed', 'closed', '', 'front-end-development', '', '', '2021-10-08 05:14:07', '2021-10-08 05:14:07', '', 0, 'https://elearning.sites.qsandbox.com/section/front-end-development/', 0, 'mto-section', '', 0),
(579, 1, '2021-10-08 05:17:19', '2021-10-08 05:17:19', '<p><strong>Why learn HTML?</strong></p><p>HTML is the standard markup language for Web pages.</p><p style=\"text-align: start\">With HTML you can create your own Website.</p><p style=\"text-align: start\">HTML is easy to learn - You will enjoy it!</p>', 'Learning HTML', '', 'publish', 'open', 'closed', '', 'learning-html', '', '', '2021-10-08 05:17:19', '2021-10-08 05:17:19', '', 575, 'https://elearning.sites.qsandbox.com/lesson/learning-html/', 0, 'mto-lesson', '', 0),
(580, 1, '2021-10-08 05:17:32', '2021-10-08 05:17:32', '<h4 style=\"text-align: start\"><strong>What you will learn?</strong></h4><p>You will learn many aspects of styling web pages! You’ll be able to set up the correct file structure, edit text and colors, and create attractive layouts. With these skills, you’ll be able to customize the appearance of your web pages to suit your every need!</p>', 'Learning CSS', '', 'publish', 'open', 'closed', '', 'learning-css', '', '', '2021-10-08 05:17:32', '2021-10-08 05:17:32', '', 575, 'https://elearning.sites.qsandbox.com/lesson/learning-css/', 1, 'mto-lesson', '', 0),
(581, 1, '2021-10-08 05:19:08', '2021-10-08 05:19:08', '<h4 style=\"text-align: start\"><strong>What you will learn?</strong></h4><p>You will learn programming fundamentals and basic object-oriented concepts using the latest JavaScript syntax. The concepts covered in these lessons lay the foundation for using JavaScript in any environment.</p>', 'Learning Javascript', '', 'publish', 'open', 'closed', '', 'learning-javascript', '', '', '2021-10-08 05:19:08', '2021-10-08 05:19:08', '', 575, 'https://elearning.sites.qsandbox.com/lesson/learning-javascript/', 2, 'mto-lesson', '', 0),
(583, 1, '2021-10-08 05:20:29', '2021-10-08 05:20:29', '', 'Designing Section', '', 'publish', 'closed', 'closed', '', 'designing-section', '', '', '2021-10-08 05:20:29', '2021-10-08 05:20:29', '', 574, 'https://elearning.sites.qsandbox.com/section/designing-section/', 1, 'mto-section', '', 0),
(584, 1, '2021-10-08 05:20:45', '2021-10-08 05:20:45', '<p><strong>Why learn Photoshop?</strong></p>\n<p>There are many reasons why you should learn Photoshop. Learning Photoshop is essential if you work in a graphic design, web design, or user experience role. Yet it is also equally important to learn Photoshop for those working in hands-on marketing roles. Whether creating flyers, brochures, or email newsletters, there is a need to know Photoshop for optimizing and retouching images. You can learn Photoshop even if you are a beginner with no previous experience.</p>\n', 'Photoshop Class', '', 'publish', 'open', 'closed', '', 'photoshop-class', '', '', '2021-10-08 05:20:45', '2021-10-08 05:20:45', '', 583, 'https://elearning.sites.qsandbox.com/lesson/photoshop-class/', 0, 'mto-lesson', '', 0),
(585, 1, '2021-10-08 05:20:58', '2021-10-08 05:20:58', '<p><strong>Why learn Figma?</strong></p>\n<p>By learning to use Figma, you\'ll take your first steps into User Interface Design and and User Experience Design. These skills are essential for building a great portfolio for yourself and potentially for your own company.</p>\n', 'Figma Class', '', 'publish', 'open', 'closed', '', 'figma-class', '', '', '2021-10-08 05:20:58', '2021-10-08 05:20:58', '', 583, 'https://elearning.sites.qsandbox.com/lesson/figma-class/', 1, 'mto-lesson', '', 0),
(587, 1, '2021-10-08 05:21:11', '2021-10-08 05:21:11', '<p><strong>Lesson description:</strong></p>\n<p>In this course we are going to start from the very basics like how to draw circles and rectangles all the way to creating complex illustrations, logos, business cards and so much more. My aim is to teach you the best ways of doing everything in Illustrator, to make you confident that you will always know which tool or feature to use in every situation.</p>\n', 'Illustrator Class', '', 'publish', 'open', 'closed', '', 'illustrator-class', '', '', '2021-10-08 05:21:11', '2021-10-08 05:21:11', '', 583, 'https://elearning.sites.qsandbox.com/lesson/illustrator-class/', 2, 'mto-lesson', '', 0),
(588, 1, '2021-10-08 05:21:22', '2021-10-08 05:21:22', '', 'Bonus', '', 'publish', 'closed', 'closed', '', 'bonus', '', '', '2021-10-08 05:21:22', '2021-10-08 05:21:22', '', 0, 'https://elearning.sites.qsandbox.com/section/bonus/', 2, 'mto-section', '', 0),
(589, 1, '2021-10-08 05:21:48', '2021-10-08 05:21:48', '<p><strong>Lesson Description:</strong></p>\n<p>Learn to design complete website using Figma.</p>\n', 'Create a complete website design using Figma', '', 'publish', 'open', 'closed', '', 'create-a-complete-website-design-using-figma', '', '', '2021-10-08 05:21:48', '2021-10-08 05:21:48', '', 588, 'https://elearning.sites.qsandbox.com/lesson/create-a-complete-website-design-using-figma/', 0, 'mto-lesson', '', 0),
(593, 1, '2021-10-08 05:27:27', '2021-10-08 05:27:27', '<p>After the completion of the course, you will walk away with complete knowledge of all the basics of Photography. You will also be a confident photographer than before.&nbsp;</p>\n<p style=\"text-align: start\">\n<p style=\"text-align: start\">The best thing about this course is anyone can learn this course. Yes, even if you haven’t touched a camera to date then even you can learn this course. There’s nothing stopping you from learning this course. Only your will is required. And above all this course is free. So, why not? Come join us today.</p>\n<p style=\"text-align: start\">\n<hr>\n<h3 style=\"text-align: start\"><strong>Who is this course for?</strong></h3>\n<p style=\"text-align: start\">\n<ul>\n<li>\n<p>Anyone who is interested.</p>\n</li>\n<li>\n<p>Anyone who is willing to invest time, yes just time no money.</p>\n</li>\n</ul>\n<hr>\n<h3 style=\"text-align: start\"><strong>What you will learn after this course?</strong></h3>\n<ul>\n<li>\n<p>You will learn to hold the camera right. Just joking.</p>\n</li>\n<li>\n<p>You will learn all the basics of photography.</p>\n</li>\n<li>\n<p>If you are serious then this might open a new career option for you.</p>\n</li>\n</ul>\n', 'Photography', '', 'publish', 'open', 'closed', '', 'photography', '', '', '2024-05-19 13:14:19', '2024-05-19 13:14:19', '', 0, 'https://elearning.sites.qsandbox.com/?post_type=mto-course&#038;p=593', 0, 'mto-course', '', 2),
(594, 1, '2021-10-08 05:29:11', '2021-10-08 05:29:11', '', 'Introduction', '', 'publish', 'closed', 'closed', '', 'introduction-2', '', '', '2021-10-08 05:29:11', '2021-10-08 05:29:11', '', 593, 'https://elearning.sites.qsandbox.com/section/introduction-2/', 0, 'mto-section', '', 0),
(595, 1, '2021-10-08 05:29:22', '2021-10-08 05:29:22', '<p>First of all, thank you for participating in this course.</p>\n<p style=\"text-align: start\">\n<p style=\"text-align: start\">Photography for Beginners is for everyone who are willing to set their foot in the path of photography.</p>\n', 'Introduction on Photography for Beginners', '', 'publish', 'open', 'closed', '', 'introduction-on-photography-for-beginners', '', '', '2024-05-19 13:14:19', '2024-05-19 13:14:19', '', 594, 'https://elearning.sites.qsandbox.com/lesson/introduction-on-photography-for-beginners/', 0, 'mto-lesson', '', 0),
(596, 1, '2021-10-08 05:29:32', '2021-10-08 05:29:32', '<h4 style=\"text-align: start\"><strong>What are the basics that you will learn?</strong></h4>\n<p style=\"text-align: start\">\n<p style=\"text-align: start\">So, following are the basics that you will learn.</p>\n<p style=\"text-align: start\">\n<ol>\n<li>\n<p>Learn to hold your camera right. Yes, it may sound funny but it\'s really important.</p>\n</li>\n<li>\n<p>You will start to hate the automatic mode.</p>\n</li>\n<li>\n<p>Understanding of the exposure triangle.</p>\n</li>\n<li>\n<p>For portraits wide aperture is the best</p>\n</li>\n<li>\n<p>For landscapes narrow aperture is the best</p>\n</li>\n<li>\n<p>Aperture Priority and Shutter Priority modes</p>\n</li>\n<li>\n<p>Raising ISO without any issue</p>\n</li>\n<li>\n<p>Make a habit of checking the ISO before you start shooting</p>\n</li>\n<li>\n<p>Be careful with your on-camera flash</p>\n</li>\n<li>\n<p>Learn to adjust white balance</p>\n</li>\n<li>\n<p>Learn to read the histogram</p>\n</li>\n<li>\n<p>Play with perspective</p>\n</li>\n</ol>\n', 'The Basics of Photography', '', 'publish', 'open', 'closed', '', 'the-basics-of-photography', '', '', '2021-10-08 05:29:32', '2021-10-08 05:29:32', '', 594, 'https://elearning.sites.qsandbox.com/lesson/the-basics-of-photography/', 1, 'mto-lesson', '', 0),
(597, 1, '2021-10-08 05:29:44', '2021-10-08 05:29:44', '', 'Important Actions', '', 'publish', 'closed', 'closed', '', 'important-actions', '', '', '2021-10-08 05:29:44', '2021-10-08 05:29:44', '', 593, 'https://elearning.sites.qsandbox.com/section/important-actions/', 1, 'mto-section', '', 0);
