(598, 1, '2021-10-08 05:29:57', '2021-10-08 05:29:57', '<p>Photography can serve many purposes and have many facets. Photography can tell a story, it can capture a moment in time, it can document, and it can be art. There are many technical uses for photography as well as social and creative ones. How we use and interact with photography is highly personal and will differ from one person to the next.</p>\n', 'Experiment &amp; Experiment', '', 'publish', 'open', 'closed', '', 'experiment-experiment', '', '', '2021-10-08 05:29:57', '2021-10-08 05:29:57', '', 597, 'https://elearning.sites.qsandbox.com/lesson/experiment-experiment/', 0, 'mto-lesson', '', 0),
(599, 1, '2021-10-08 05:30:09', '2021-10-08 05:30:09', '<p>Photography can serve many purposes and have many facets. Photography can tell a story, it can capture a moment in time, it can document, and it can be art. There are many technical uses for photography as well as social and creative ones. How we use and interact with photography is highly personal and will differ from one person to the next.</p>', 'Pay attention in backgroud', '', 'publish', 'open', 'closed', '', 'pay-attention-in-backgroud', '', '', '2021-10-08 05:30:09', '2021-10-08 05:30:09', '', 597, 'https://elearning.sites.qsandbox.com/lesson/pay-attention-in-backgroud/', 1, 'mto-lesson', '', 0),
(600, 1, '2021-10-08 05:30:20', '2021-10-08 05:30:20', '<p>Photography can serve many purposes and have many facets. Photography can tell a story, it can capture a moment in time, it can document, and it can be art. There are many technical uses for photography as well as social and creative ones. How we use and interact with photography is highly personal and will differ from one person to the next.</p>', 'Invest in Tripod', '', 'publish', 'open', 'closed', '', 'invest-in-tripod', '', '', '2021-10-08 05:30:20', '2021-10-08 05:30:20', '', 597, 'https://elearning.sites.qsandbox.com/lesson/invest-in-tripod/', 2, 'mto-lesson', '', 0),
(601, 1, '2021-10-08 05:30:27', '2021-10-08 05:30:27', '<p>Lighting can make or break a photo, and the early morning and evening are widely thought to be the best times of day for taking photos. In photography, the hour just after the sun rises or before it sets is called the “golden hour,” because the sun is lower in the sky and the light is softer and warmer.</p>\n<p style=\"text-align: start\">Whether you’re shooting landscapes, portraits or still life, using the early morning or evening light can give your photos a serene feel with its warm glow and the long shadows it casts. Of course, the golden hour is not the only time you can get good outdoor photos, but it does make it easier.</p>\n<p style=\"text-align: start\">Lighting can make or break a photo, and the early morning and evening are widely thought to be the best times of day for taking photos. In photography, the hour just after the sun rises or before it sets is called the “golden hour,” because the sun is lower in the sky and the light is softer and warmer.</p>\n<p style=\"text-align: start\">Whether you’re shooting landscapes, portraits or still life, using the early morning or evening light can give your photos a serene feel with its warm glow and the long shadows it casts. Of course, the golden hour is not the only time you can get good outdoor photos, but it does make it easier.</p>\n', 'Shoot in Early Morning or Evening', '', 'publish', 'open', 'closed', '', 'shoot-in-early-morning-or-evening', '', '', '2021-10-08 05:30:27', '2021-10-08 05:30:27', '', 597, 'https://elearning.sites.qsandbox.com/lesson/shoot-in-early-morning-or-evening/', 3, 'mto-lesson', '', 0),
(602, 1, '2021-10-08 05:31:18', '2021-10-08 05:31:18', '<p>Photography can serve many purposes and have many facets. Photography can tell a story, it can capture a moment in time, it can document, and it can be art. There are many technical uses for photography as well as social and creative ones. How we use and interact with photography is highly personal and will differ from one person to the next.</p>', 'Learn from Your Mistakes', '', 'publish', 'open', 'closed', '', 'learn-from-your-mistakes', '', '', '2021-10-08 05:31:18', '2021-10-08 05:31:18', '', 597, 'https://elearning.sites.qsandbox.com/lesson/learn-from-your-mistakes/', 4, 'mto-lesson', '', 0),
