(903, 1, '2021-12-09 15:14:15', '2021-12-09 15:14:15', '<p>Advanced Sketch and Painting Classes to all the students on time as per the requirements. Our Classes include Acrylic Painting, Oil Painting, Watercolor Painting, Charcoal Drawing, Postal Drawing. Professional Painter and Sketch Artist in Kathmandu and you are searching for the Best Art Institute in Kathmandu that can provide proper Advance art classes to all the students, you can join our very best classes. We have a Professional Art Teacher in Kathmandu providing proper Advanced Sketch and Painting Classes to all the students on time as per the requirements. Our Classes include Acrylic Painting, Oil Painting, Watercolor Painting, Charcoal Drawing, Postal Drawing.</p>', 'Sketching &amp; Painting quiz', '', 'publish', 'open', 'closed', '', 'sketching-painting-quiz', '', '', '2021-12-09 15:14:15', '2021-12-09 15:14:15', '', 902, 'https://demo.masteriyo.com/elearning/quiz/sketching-painting-quiz/', 0, 'mto-quiz', '', 0),
