(907, 1, '2021-12-09 15:19:07', '2021-12-09 15:19:07', '<p>The guitar is played by plucking the strings. The main parts of a guitar are the body, the fretboard, the headstock and the strings. Guitars are usually made from wood or plastic. Their strings are made of steel or nylon.</p><p style=\"text-align: start\">The guitar strings are plucked with the of the right hand (or left hand, for left handed players), or a small pick made of thin plastic. This type of pick is called a or guitar pick. The left hand holds the neck of the guitar while the fingers pluck the strings. Different finger positions on the fretboard make different notes.</p>', 'Guitar quiz', '', 'publish', 'open', 'closed', '', 'guitar-quiz', '', '', '2021-12-09 15:19:07', '2021-12-09 15:19:07', '', 906, 'https://demo.masteriyo.com/elearning/quiz/guitar-quiz/', 0, 'mto-quiz', '', 0),
