(911, 1, '2021-12-09 15:24:54', '2021-12-09 15:24:54', '<p>WordPress is an open source, free website creation tool written in the programming language PHP. It is licensed under General Public License, which allows anyone to not only use the software but also to modify it to suit individual needs and share those modifications with others. “Open source” software is publicly available and always free so that WordPress can be downloaded at any time or installed as part of a web hosting package.</p>', 'WordPress Quiz', '', 'publish', 'open', 'closed', '', 'wordpress-quiz', '', '', '2021-12-09 15:24:54', '2021-12-09 15:24:54', '', 910, 'https://demo.masteriyo.com/elearning/quiz/wordpress-quiz/', 0, 'mto-quiz', '', 0),
