(914, 1, '2021-12-09 15:50:53', '2021-12-09 15:50:53', '<p>The piano is an acoustic, keyboard and stringed musical instrument invented in Italy by Bartolomeo Cristofori around the year 1700, in which the strings are struck by wooden hammers that are coated with a softer material.</p><p>Use your computer keyboard or click the piano keys to play the piano. The keyboard\'s top row of letters correspond to the white keys, and the row of numbers correspond to the black keys. You can play multiple notes simultaneously.</p>', 'Piano quiz', '', 'publish', 'open', 'closed', '', 'piano-quiz', '', '', '2021-12-09 15:50:53', '2021-12-09 15:50:53', '', 913, 'https://demo.masteriyo.com/elearning/quiz/piano-quiz/', 0, 'mto-quiz', '', 0),
