(918, 1, '2021-12-09 15:55:35', '2021-12-09 15:55:35', '<p>Travel is the movement of people between distant geographical locations. Travel can be done by foot, bicycle, automobile, train, boat, bus, airplane, ship or other means, with or without luggage, and can be one way or round trip.</p><p>All regions of Japan are covered by the campaign. There is a possibility for some areas to be temporarily excluded from the campaign depending on the spread of the virus.</p>', 'Travel quiz', '', 'publish', 'open', 'closed', '', 'travel-quiz', '', '', '2021-12-09 15:55:35', '2021-12-09 15:55:35', '', 917, 'https://demo.masteriyo.com/elearning/quiz/travel-quiz/', 0, 'mto-quiz', '', 0),
