(924, 1, '2021-12-09 16:14:14', '2021-12-09 16:14:14', '<p>A business is defined as an organization or enterprising entity engaged in commercial, industrial, or professional activities. Businesses can be for-profit entities or non-profit organizations. Business types range from limited liability companies, sole proprietorships, corporations, and partnerships.</p><p>The origin of the word \"travel\" is most likely lost to history. The term \"travel\" may originate from the word <em>travail</em>, which means \'work\'. According to the Merriam Webster dictionary, the first known use of the word <em>travel</em> was in the 14th century. It also states that the word comes from Middle English <em>travailen</em>, <em>travelen</em> (which means to torment, labor, strive, journey) and earlier from Old French <em>travailler</em> (which means to work strenuously, toil).</p>', 'Business quiz', '', 'publish', 'open', 'closed', '', 'travel-quiz-2', '', '', '2021-12-09 16:14:14', '2021-12-09 16:14:14', '', 923, 'https://demo.masteriyo.com/elearning/quiz/travel-quiz-2/', 0, 'mto-quiz', '', 0),
