(928, 1, '2021-12-09 16:19:42', '2021-12-09 16:19:42', '<p>With the help of this section, the contestants can know the topics that are included in the SASS Quiz. Aspirants can see the SASS Questions from Syntax, CSS Extensions, Comments, Script, @-Rules and Directives, Mixin Directives, Function Directives, Output Style, etc. Thus, the contenders can verify all the questions and know the answers to all of them. Competitors can increase the confidence levels by practicing the SASS Online Test.</p>', 'CSS and SASS quiz', '', 'publish', 'open', 'closed', '', 'css-and-sass-quiz', '', '', '2021-12-09 16:19:42', '2021-12-09 16:19:42', '', 927, 'https://demo.masteriyo.com/elearning/quiz/css-and-sass-quiz/', 0, 'mto-quiz', '', 0),
