(932, 1, '2021-12-09 16:24:40', '2021-12-09 16:24:40', '<p>Line art or line drawing is any image that consists of distinct straight or curved lines placed against a background, without gradations in shade or hue to represent two-dimensional or three-dimensional objects. Line art can use lines of different colors, although line art is usually monochromatic.</p>\n', 'Arts and Line drawing quiz', '', 'publish', 'open', 'closed', '', 'arts-and-line-drawing-quiz', '', '', '2021-12-09 16:24:40', '2021-12-09 16:24:40', '', 931, 'https://demo.masteriyo.com/elearning/quiz/arts-and-line-drawing-quiz/', 0, 'mto-quiz', '', 0),
